import React, {useState} from 'react';
import {Tabs,Tab,Button} from 'react-bootstrap';


function ClassTab() {

    const [key, setKey] = useState('class1');

    return (
      <Tabs id="controlled-tab-example" activeKey={key} onSelect={k => setKey(k)}>
        <Tab eventKey="class1" title="class1">
        <Button variant="primary" className="icon expand" href="#" target="_blank"><strong>Class 1</strong></Button>
        </Tab>
        <Tab eventKey="class2" title="class2">
        <Button variant="primary" className="icon expand" href="#" target="_blank"><strong>Class 2</strong></Button>
        </Tab>
        <Tab eventKey="class3" title="class3">
        <Button variant="primary" className="icon expand" href="#" target="_blank"><strong>Class 3</strong></Button>
            </Tab>
            <Tab eventKey="class4" title="class4">
            <Button variant="primary" className="icon expand" href="#" target="_blank"><strong>Class 4</strong></Button>
            </Tab>
            <Tab eventKey="class5" title="class5">
            <Button variant="primary" className="icon expand" href="#" target="_blank"><strong>Class 5</strong></Button>
            </Tab>
      </Tabs>
);
}
export default ClassTab;
